import React from 'react'

const Filmdetails = () => {

    axios({
        method: 'get',
        url: "http://api.openweathermap.org/data/2.5/weather?q=Mecca&units=metric&APPID=fddde78406af0a2e6faa75a479923d3f"
    })
    return (
    <div className="film-details">
        <h1 className="section-title">DETAILS</h1>
    </div>
    )
}

export default Filmdetails
